tClickCount(a.getClickCount() + b.getClickCount()); a.setOrderCount(a.getOrderCount() + b.getOrderCount()); a.setPayCount(a.getPayCount() + b.getPayCount()); return a; }); JavaRDD<CategoryCountInfo> mapRDD = stringCategoryCountInfoJavaPairRDD.map(pair -> pair._2); JavaRDD<CategoryCountInfo> sortRDD = mapRDD.sortBy(obj -> obj, false, 2); List<CategoryCountInfo> takeSort = sortRDD.take(10); for (CategoryCountInfo categoryCountInfo : takeSort) { System.out.println(categoryCountInfo); } // 4. 关闭sc jsc.stop(); } } class CategoryCountInfo implements Comparable<CategoryCountInfo>, Serializable { private String categoryId; private Long clickCount; private Long orderCount; private Long payCount; public CategoryCountInfo() { } public CategoryCountInfo(String categoryId, Long clickCount, Long orderCount, Long payCount) { this.categoryId = categoryId; this.clickCount = clickCount; this.orderCount = orderCount; this.payCount = payCount; } public String getCategoryId() { return categoryId; } public void setCategoryId(String categoryId) { this.categoryId = categoryId; } public Long getClickCount() { return clickCount; } public void setClickCount(Long clickCount) { this.clickCount = clickCount; } public Long getOrderCount() { return orderCount; } public void setOrderCount(Long orderCount) { this.orderCount = orderCount; } public Long getPayCount() { return payCount; } public void setPayCount(Long payCount) { this.payCount = payCount; } @Override public String toString() { return "CategoryCountInfo{" + "categoryId='" + categoryId + '\'' + ", clickCount=" + clickCount + ", orderCount=" + orderCount + ", payCount=" + payCount + '}'; } @Override public int compareTo(@NotNull CategoryCountInfo other) { if (this.clickCount > other.clickCount) { return 1; } else if (this.clickCount < other.clickCount) { return -1; } else { if (this.orderCount > other.orderCount) { return 1; } else if (this.orderCount < other.orderCount) { return -1; } else { return this.payCount.compareTo(other.payCount);