 } @Override //计算最终结果 public Long finish(AvgAgeBuffer buffer) { return buffer.getSum()/buffer.getCount(); } @Override public Encoder<AvgAgeBuffer> bufferEncoder() { return Encoders.bean(AvgAgeBuffer.class); } @Override public Encoder<Long> outputEncoder() { return Encoders.LONG(); } } import java.io.Serializable; public class AvgAgeBuffer implements Serializable { private long sum = 0; private long count = 0; public AvgAgeBuffer() { } public AvgAgeBuffer(long sum, long count) { this.sum = sum; this.count = count; } public long getSum() { return sum; } public void setSum(long sum) { this.sum = sum; } public long getCount() { return count; } public void setCount(long count) { this.count = count; } }

