Spark在流式数据的处理场景中对核心功能环境进行了封装 package com.zzw.bigdata.spark.sparkstreaming; import org.apache.spark.SparkConf;
import org.apache.spark.streaming.Duration;
import org.apache.spark.streaming.Durations;
import org.apache.spark.streaming.api.java.JavaStreamingContext; public class SparkStreamingEnv01 { public static void main(String[] args) throws Exception { SparkConf conf = new SparkConf(); conf.setAppName("SparkStreamingEnv01"); conf.setMaster("local[2]"); JavaStreamingContext javaStreamingContext = new JavaStreamingContext(conf, new Duration(3 * 1000)); javaStreamingContext.start();
// 等待数据采集器的结束，如果采集器停止运行，那么main线程会继续执行 javaStreamingContext.awaitTermination();
// 数据采集器是一个长期执行的任务，所以不能停止，也不能释放资源，只能等待任务结束
// javaStreamingContext.close();
// while (true) {
// } }
} 上面的代码执行会抛出异常Exception in thread "main" java.lang.IllegalArgumentException: requirement failed: No output operations registered, so nothing to execute 原因：没有启动行动算子。 Spark Streaming对应的是无界数据流，没有启动行动算子比如print()就会报错。 Socket数据不会保留，不输出就会出问题。 你的代码抛出 java.lang.IllegalArgumentException: requirement failed: No output operations registered, so nothing to execute 的异常是因为在创建 JavaStreamingContext 后没有注册任何输出操作（如接收输入流，处理数据等），Spark Streaming 在没有任何操作的情况下无法执行任务。 解决方案 ： 需要创建一个输入流，比如通过 socketTextStream 或者其他接收源。 注册一些输出操作，例如调用 print()、saveAsTextFiles() 等方法来处理数据。 以下是一个修正后的代码示例，假设使用 socketTextStream 来接收数据： import org.apache.spark.SparkConf;
import org.apache.spark.streaming.Duration;
import org.apache.spark.streaming.api.java.JavaPairDStream;
import org.apache.spark.streaming.api.java.JavaStreamingContext;
import org.apache.spark.streaming.api.java.JavaDStream;
import org.apache.spark.streaming.api.java.JavaInputDStream;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.VoidFunction;
import java.util.Arrays; public class SparkStreamingEnv01 { public static void main(String[] args) throws Exception { SparkConf conf = new SparkConf(); conf.setAppName("SparkStreamingEnv01"); conf.setMaster("local[2]"); JavaStreamingContext javaStreamingContext = new JavaStreamingContext(conf, new Duration(3000)); // 创建一个输入流，假设我们在 localhost:9999 上接收数据 JavaInputDStream<String> lines = javaStreamingContext.socketTextStream("localhost", 9999); // 注册输出操作，例如打印接收到的每一行 lines.foreachRDD(new VoidFunction<JavaRDD<String>>() { @Override public void call(JavaRDD<String> rdd) throws Exception { // 打印每一行 rdd.foreach(line -> System.out.println(line)); } }); javaStreamingContext.start(); javaStreamingContext.awaitTermination(); }
} 注意事项： 输入源 ：你需要在运行前确保有一个 socket 服务在 localhost:9999 监听。可以使用 nc -lk 9999 命令在终端开启一个简单的字符发送服务。 依赖 ：确保你的项目能找到 Spark 的相关依赖。 这段代码创建了一个接收来自 localhost 在 9999 端口的文本流，并且会将接收到的每一行打印到控制台。这种方式可以确保有输出操作被注册，避免抛出上述异常。

