在企业开发中往往常用的基本序列化类型不能满足所有需求，比如在 Hadoop 框架内部传递一个 bean 对象，那么该对象就需要实现序列化接口。 具体实现 bean 对象序列化步骤如下 7 步。 （1）必须实现 Writable 接口 （2）反序列化时，需要反射调用空参构造函数，所以必须有空参构造 public FlowBean () { super ();
} （3）重写序列化方法 @Override
public void write (DataOutput out) throws IOException { out.writeLong (upFlow); out.writeLong (downFlow); out.writeLong (sumFlow);
} （4）重写反序列化方法 @Override
public void readFields (DataInput in) throws IOException { upFlow = in.readLong (); downFlow = in.readLong (); sumFlow = in.readLong ();
} （5） 注意 反序列化的顺序和序列化的顺序完全一致 （6）要想把结果显示在文件中，需要重写 toString ()，可用”\t” 分开，方便后续用。 （7）如果需要将自定义的 bean 放在 key 中传输，则还需要实现 Comparable 接口，因为 MapReduce 框中的 Shuffle 过程要求对 key 必须能排序。详见后面排序案例。 @Override
public int compareTo (FlowBean o) { // 倒序排列，从大到小 return this.sumFlow > o.getSumFlow () ? -1 : 1;
}

